    /**
     * Cantidad exacta de presets disponibles.
     */
    public const PRESET_COUNT = \count(self::$presets);

    /**
     * Índice interno para recorrer presets.
     *
     * @var int
     */
    protected static int $index = 0;

    /**
     * Define el estado por defecto del factory.
     *
     * @return array<string,mixed>
     * @throws Exception si ya no quedan presets
     */
    public function definition(): array
    {
        if (static::$index >= self::PRESET_COUNT) {
            throw new Exception('No quedan presets de tarifas disponibles.');
        }

        $choice = self::$presets[static::$index++];

        return [
            // Buscar el destino existente por nombre
            'destino_id'           => Destino::where('nombre', $choice['destino'])->value('id'),
            // Buscar el cliente existente por razón social
            'cliente_principal_id' => Cliente::where('razon_social', $choice['cliente'])->value('id'),
            'tipo'                 => $choice['tipo'],
            'valor_factura'        => $choice['valor_factura'],
            'valor_comision'       => $choice['valor_comision'],
        ];
    }
